export const CalendarView = () => {
  return (
    <MainContainer>
      <InnerBoxHeader>
        <InnerBoxTitle>달력</InnerBoxTitle>
      </InnerBoxHeader>
      <InnerBoxContainer>
        <Margin36 />
      </InnerBoxContainer>
    </MainContainer>
  )
}
